--[[========================================================================================
      If you are making use of LibAdvancedIconSelector in your addon:
      
      You CAN package this keyword data alongside your addon so that
      AdvancedIconSelector doesn't have to be installed for your icons to
      have keywords, but you'll need to rename this folder so that your addon
      can be installed side-by-side with AIS.  The keyword data should not be
      embedded in your addon, however, as it's designed to be loaded on-demand.
      
      For example, if you want to package keyword data alongside an addon named
      "Foo" that makes use of the icon selector, then you should:
        a) Rename this folder from "AdvancedIconSelector-KeywordData" to "Foo-KeywordData"
        b) Change the title in the TOC to "Foo [KeywordData]" or something similar
        c) Change X-Part-Of in the TOC to "Foo" (used by Addon Control Panel)
        d) Change ADDON_NAME below to "Foo-KeywordData" (but do NOT change MAJOR_VERSION)
        e) Specify keywordAddonName = "Foo-KeywordData" in the options table passed to
             CreateIconSelectorWindow / CreateIconSelectorFrame / CreateSearch.  This will
             tell LAIS to use your keyword library if it's newer than the currently loaded
             / default one.
      
      Do not change the X-Revision number in the TOC unless you've got a very good reason
      to prioritize your keyword library over the one provided by AIS.
    ========================================================================================]]

local ADDON_NAME = "BetterIconSelector-KeywordData"

-- Do NOT change the MAJOR_VERSION string to the name of your addon, however,
-- as this is used to obtain the most up-to-date keyword data, regardless of
-- what addon it came from.
local MAJOR_VERSION = "LibAdvancedIconSelector-KeywordData-1.0"
local MINOR_VERSION = tonumber(GetAddOnMetadata(ADDON_NAME, "X-Revision"))

if not LibStub then error(ADDON_NAME .. " requires LibStub to operate") end
local lib = LibStub:NewLibrary(MAJOR_VERSION, MINOR_VERSION)
if not lib then return end

local DEBUG = false
function lib:Debug(...)
	if DEBUG then
		print("|cff00ff00[AIS-KWD] [Debug]|r", ...)
	end
end

lib:Debug("Keyword data loaded!")

-- Returns the keyword library revision, as specified by X-Revision in the TOC.
function lib:GetRevision()
	return MINOR_VERSION
end

-- Returns the keywords associated with the given texture filename.
function lib:GetKeywords(texture)
	if texture then
		return lib.keywords[strlower(texture)]
	end
end

